import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class AppRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="appResults">
				<div className="percent_accepted">{this.props.percent_accepted}</div>
				<div className="size">{this.props.size}</div>
                <div className="url_school">{this.props.url_school}</div>
				<div className="url_application">{this.props.url_application}</div>
			</div>
		);
	}
}
